import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import jsPDF from 'jspdf';
import 'jspdf-autotable';
import { CdkDragDrop, moveItemInArray, transferArrayItem } from '@angular/cdk/drag-drop';
import { ApiService } from '../../services/api.service';
import { User } from '../../interfaces/user';
import { UserService } from '../../services/user.service';
import { CategoriesComponent } from '../groups/categories/categories.component';
import { GroupsService } from 'src/app/services/groups.service';

@Component({
  selector: 'app-report-pdf',
  templateUrl: './report-pdf.component.html',
  styleUrls: ['./report-pdf.component.scss']
})
export class ReportPdfComponent implements OnInit {

  constructor(
    private api: ApiService,
    private userService: UserService,
    public formBuilder: FormBuilder,
    private groupService: GroupsService
  ) {
    this.currentUser = this.userService.getCurrentUser();
  }

  currentUser: User; // Interfaces
  public contacts: any = [];

  public categories: any[] = [];
  public groups: any[] = []


  public todo = [
    { title: 'City', field: 'ciudad' },
    { title: 'Street', field: 'calle' },
    { title: 'State', field: 'provincia' },
    { title: 'Sex', field: 'sexo' },
    { title: 'Marital status', field: 'estadoCivil' }
  ];

  public done = [
    { title: 'First name', field: 'name' },
    { title: 'E-mail', field: 'email' },
    { title: 'Cell-phone', field: 'telefono' }

  ];
  // Select categorias Opcion
  public selectCatOptions: any = {
    singleSelection: true,
    idField: 'idGroupCategory',
    textField: 'name',
    allowSearchFilter: true
  }
  // Select groups Opcion
  public multiSelectGroups: any = {
    singleSelection: true,
    idField: 'idGroup',
    textField: 'title',
    allowSearchFilter: true
  }

  // Form
  public filtroFormGroup: FormGroup = this.formBuilder.group({
    Groups: [[]],
    Categories: [[]]
  })


  crearPdf(form: FormGroup) {

    console.log(this.contacts);

    const columns = [];
    const date = [];
    // LLENAR COLUMNAS SELECCIONADAS
    for (let item of this.done) {
      columns.push(item.title);
    }
    // LISTA DE CONTACTOS
    for (let contact of this.contacts) {
      const agregar = [];
      for (let col of columns) {
        if (col === "City") {
          agregar.push(contact.ciudad);
        }
        if (col === "Street") {
          agregar.push(contact.calle);
        }
        if (col === "State") {
          agregar.push(contact.provincia);
        }
        if (col === "Sex") {
          agregar.push(contact.sexo);
        }
        if (col === "Marital status") {
          agregar.push(contact.estadoCivil);
        }
        if (col === "First name") {
          agregar.push(contact.nombre + ' ' + contact.apellido);
        }
        if (col === "E-mail") {
          agregar.push(contact.email);
        }
        if (col === "Cell-phone") {
          agregar.push(contact.telefono);
        }
      }
      date.push(agregar);
    }

    // Clone object
    let payload: any = Object.assign({}, form.value);

    if (!payload.groups) {
      payload.groups = []
    }
    if (!payload.categories) {
      payload.categories = []
    }

    payload.groups = payload.Groups.map(Groups => Groups.titulo)
    payload.categories = payload.Categories.map(Categories => Categories.descripcion)

    const doc = new jsPDF();
    var imgData = 'data:image/png;base64, '



    doc.addImage(imgData, 'JPEG', 15, 10, 29, 24);
    doc.setFontSize(20);
    doc.setFontType("bold");
    doc.text(70, 60, "REPORT CONTACT");
    doc.setLineWidth(0.5);
    doc.line(70, 62, 136, 62);

    if (payload.groups != '') {
      doc.setFontType("bold");
      doc.setFontSize(12);
      doc.text(15, 75, "GROUP: ");
      doc.setFontType("normal");
      doc.text(45, 75, payload.groups);
    }
    if (payload.categories != '') {
      doc.setFontType("bold");
      doc.setFontSize(12);
      doc.text(15, 80, "CATEGORIES: ");
      doc.setFontType("normal");
      doc.text(45, 80, payload.categories);
    }
    let alto: number
    if (payload.groups != '' && payload.categories != '') {
      alto = 85
    }
    else {
      alto = 75
    }
    doc.autoTable(columns, date,
      {
        margin: { top: alto }, columnStyles: {
          id: { fillColor: 255 }
        },
      });
    doc.save('ListContact.pdf');

  }

  getGroups() {
    this.groupService.getGroups()
      .subscribe(
        (data: any) => {
          this.groups = data.groups;
        },
        error => console.error(error)
      )
  }
  getCategories() {
    this.api.get('groups/getGroupsCategories', { idIglesia: this.currentUser.idIglesia })
      .subscribe(
        (data: any) => {
          this.categories = data.categories
        }
      )
  }

  // Method for make request to api
  getContacts(idIglesia: number) {
    this.api.get(
      `getUsuarios`, {
      idIglesia: idIglesia
    }
    ).subscribe(
      (contacts: any) => {

        this.contacts = contacts.usuarios.filter(u => u.estatus == true)
        console.log(this.contacts);

      },
      err => console.log(err)
    );
  }
  ngOnInit() {
    // Obtain the idIglesia from currentUser of user.service
    this.getContacts(this.currentUser.idIglesia);
    this.getCategories();
    this.getGroups();
  }

  drop(event: CdkDragDrop<string[]>) {
    if (event.previousContainer === event.container) {
      moveItemInArray(event.container.data, event.previousIndex, event.currentIndex);
    } else {
      transferArrayItem(event.previousContainer.data,
        event.container.data,
        event.previousIndex,
        event.currentIndex);
    }
  }
}
